mapper.select:
select 

from TRSDET_SWITCHED
where BRANCH_CODE = #{BRANCH_CODE}
  and CODE = #{CODE}
  and COMP_CODE = #{COMP_CODE}
  and LINE_NO = #{LINE_NO}
  and SERIAL_NO = #{SERIAL_NO}

mapper.delete:
delete from TRSDET_SWITCHED
where BRANCH_CODE = #{BRANCH_CODE}
  and CODE = #{CODE}
  and COMP_CODE = #{COMP_CODE}
  and LINE_NO = #{LINE_NO}
  and SERIAL_NO = #{SERIAL_NO}
